import React from 'react'
import "./home.css"
import AnimatedText from 'react-animated-text-content';

export default function HomeSection() {
  return (
      <div className='home'>
        <div className='text-container'>
          <p>Hello,</p>
          <p>I'M Kasthury T</p>
          <p>I am Undergrauate at</p>
          <p>University of sri jayewardenepura.</p>
          <a href="contact.html"><button class="hire-btn">Hire me</button></a>
			    <a href="portfolio1.html" download><button class="down-cv">Download CV</button></a>
        </div>
        <div className='person-img'>
          <img src='././assets/personImg.png'></img>
        </div>

            <AnimatedText
      type="words" // animate words or chars
      animation={{
        x: '200px',
        y: '-20px',
        scale: 1.1,
        ease: 'ease-in-out',
      }}
      animationType="float"
      interval={0.06}
      duration={0.8}
      tag="p"
      className="animated-paragraph"
      includeWhiteSpaces
      threshold={0.1}
      rootMargin="20%"
    >
      Content to animate
    </AnimatedText>;
      </div>
  )
}
